import React, { useContext } from "react";
import "./ShipmentInformationBlock.scss";
import { Outlet } from "react-router-dom";
import ShipmentContext from "../../../context/ShipmentContext";

const ShipmentInformationBlock = () => {
  const [currentShipment] = useContext(ShipmentContext);
  
  return <div className="shipmentinfo-container">
    <h1>{currentShipment.name}</h1>
    {/* <Outlet/> */}
  </div>;
};

export default ShipmentInformationBlock;
